class MyProfileComponent {
    constructor(title, router, auth, modalService, fb, activatedRoute) {
        this.title = title;
        this.router = router;
        this.auth = auth;
        this.modalService = modalService;
        this.fb = fb;
        this.activatedRoute = activatedRoute;
        this.updateProfileError = "";
        this.uploadProfilePictureLoading = false;
        this.deleteProfilePictureLoading = false;
        this.pageLoading = true;
        this.editLoading = false;
        this.deleteAccountLoading = false;
        title.setTitle('My Profile');
        if (activatedRoute.snapshot.data.profile) {
            this.pageLoading = false;
            this.userInfo = activatedRoute.snapshot.data.profile;
        }
    }
    ngOnInit() {
    }
    chooseImage(event) {
        this.choosenImage = event.target.files[0];
    }
    uploadImage() {
        this.uploadProfilePictureLoading = true;
        let profileePic = new FormData();
        profileePic.append('profilePhoto', this.choosenImage);
        this.setImageSub = this.auth.setUserImage(profileePic).subscribe((res) => {
            this.uploadProfilePictureLoading = false;
            this.modalRef.hide();
            this.userInfo = res;
        }, err => {
            this.uploadProfilePictureLoading = false;
            alert(err.error.error);
        });
    }
    editProfile(value) {
        this.editLoading = true;
        let body = {};
        if (value.password)
            body.password = value.password;
        body.name = value.name;
        body.email = value.email;
        this.userInfoSub = this.auth.updateUserInfo(body, this.userInfo._id).subscribe((res) => {
            this.editLoading = false;
            this.updateProfileError = '';
            this.userInfo = res.result;
            this.modalService.hide();
        }, err => {
            this.editLoading = false;
            this.updateProfileError = err.error.errors;
        });
    }
    openModal(template) {
        this.modalRef = this.modalService.show(template);
        this.updateProfileForm = this.fb.group({
            name: `${this.userInfo.name}`,
            email: `${this.userInfo.email}`,
            password: ''
        });
    }
    deleteProfilePic() {
        this.deleteProfilePictureLoading = true;
        this.deleteImgSub = this.auth.deleteProfilePic().subscribe(res => {
            this.deleteProfilePictureLoading = false;
            this.userInfo = res;
            this.modalService.hide();
        }, err => {
            this.deleteProfilePictureLoading = false;
            alert(err.error.error);
        });
    }
    deleteUser() {
        this.deleteAccountLoading = true;
        this.deleteAccountSub = this.auth.deleteUser().subscribe(res => {
            this.deleteAccountLoading = false;
            localStorage.removeItem('goodreadsToken');
            this.modalService.hide();
            this.router.navigate(['/home']);
        }, err => {
            this.deleteAccountLoading = false;
            alert(err.error.error);
        });
    }
    ngOnDestroy() {
        if (this.setImageSub)
            this.setImageSub.unsubscribe();
        if (this.userInfoSub)
            this.userInfoSub.unsubscribe();
        if (this.deleteImgSub)
            this.deleteImgSub.unsubscribe();
        if (this.deleteAccountSub)
            this.deleteAccountSub.unsubscribe();
    }
}
